SET standard_conforming_strings = OFF;
DROP TABLE IF EXISTS "sng"."routes" CASCADE;
DELETE FROM geometry_columns WHERE f_table_name = 'routes' AND f_table_schema = 'sng';
BEGIN;
CREATE TABLE "sng"."routes" ( "ogc_fid" SERIAL, CONSTRAINT "routes_pk" PRIMARY KEY ("ogc_fid") );
SELECT AddGeometryColumn('sng','routes','wkb_geometry',4326,'LINESTRING',2);
CREATE INDEX "routes_wkb_geometry_geom_idx" ON "sng"."routes" USING GIST ("wkb_geometry");
ALTER TABLE "sng"."routes" ADD COLUMN "name" VARCHAR;
ALTER TABLE "sng"."routes" ADD COLUMN "description" VARCHAR;
ALTER TABLE "sng"."routes" ADD COLUMN "timestamp" timestamp with time zone;
ALTER TABLE "sng"."routes" ADD COLUMN "begin" timestamp with time zone;
ALTER TABLE "sng"."routes" ADD COLUMN "end" timestamp with time zone;
ALTER TABLE "sng"."routes" ADD COLUMN "altitudemode" VARCHAR;
ALTER TABLE "sng"."routes" ADD COLUMN "tessellate" NUMERIC(10,0);
ALTER TABLE "sng"."routes" ADD COLUMN "extrude" NUMERIC(10,0);
ALTER TABLE "sng"."routes" ADD COLUMN "visibility" NUMERIC(10,0);
ALTER TABLE "sng"."routes" ADD COLUMN "draworder" NUMERIC(10,0);
ALTER TABLE "sng"."routes" ADD COLUMN "icon" VARCHAR;
COMMIT;
